import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>418 I'm a teapot</h1>
        <div className="teapot-container">
          <pre className="ascii-art">
            {`
               ;,'
     _o_    ;:;'
 ,-.'---'.__ ;
((j'======',-'
 \`-\     /
    \`-=-'
            `}
          </pre>
        </div>
        <p>
          Le statut HTTP 418 est un code de réponse humoristique du protocole HTTP.
          Il signifie "I'm a teapot" (Je suis une théière).
        </p>
      </header>
    </div>
  );
}

export default App;
